import React, { useEffect, useState } from "react";
import { Tabs } from "antd";
import httpServ from "../../../services/http.service";

const { TabPane } = Tabs;

export default function TabsPhim(props) {
  const [heThongRap, setHeThongRap] = useState([]);
  useEffect(() => {
    httpServ
      .layThongTinLichChieuHeThongRap()
      .then((res) => {
        console.log("res", res);
        setHeThongRap(res.data.content);
        {
          res.data.content?.map((heThongRap, index) => {
            return (
              <Tabs
                key={index}
                tabPosition={"left"}
                defaultActiveKey="0"
                className="mt-20"
              >
                <TabPane
                  tab={
                    <img
                      src={heThongRap.logo}
                      className="rounded-full"
                      width={60}
                    />
                  }
                  key="1"
                >
                  Content of Tab 1
                </TabPane>
              </Tabs>
            );
          });
        }
      })
      .catch((err) => {
        console.log("err", err);
      });
  }, []);
  console.log("heThongRap", heThongRap);
  return (
    <Tabs tabPosition={"left"} defaultActiveKey="0" className="mt-20">
      <TabPane
        tab={
          <img
            src="https://picsum.photos/200"
            className="rounded-full"
            width={60}
          />
        }
        key="1"
      >
        Content of Tab 1
      </TabPane>
    </Tabs>
  );
}
